                letterGrades.add("C+");
            } else if (grades.get(i) >= 1.7) {
                letterGrades.add("C");
            } else if (grades.get(i) >= 1.3) {
                letterGrades.add("C-");
            } else if (grades.get(i) >= 1.0) {
                letterGrades.add("D+");
            } else if (grades.get(i) >= 0.7) {
                letterGrades.add("D");
            } else if (grades.get(i) >= 0.0) {
                letterGrades.add("D-");
            } else {
                letterGrades.add("E");
            }
        }
