        if (test.length() == 0) {
            return result;
        }
        String[] letters = test.split(" ");
        for (String letter : letters) {
            if (result.containsKey(letter)) {
                result.put(letter, result.get(letter) + 1);
            } else {
                result.put(letter, 1l);
