        if (interval1.getValue0() > interval1.getValue1()) {
            throw new IllegalArgumentException("Interval 1 is not valid");
        }
        if (interval2.getValue0() > interval2.getValue1()) {
            throw new IllegalArgumentException("Interval 2 is not valid");
        }
        if (interval1.getValue1() < interval2.getValue0() || interval1.getValue0() > interval2.getValue1()) {
            return "NO";
        }
        long start = Math.max(interval1.getValue0(), interval2.getValue0());
        long end = Math.min(interval1.getValue1(), interval2.getValue1());
        long length = end - start + 1;
        if (BigInteger.valueOf(length).isProbablePrime(100)) {
            return "YES";
        }
        return "NO";

